        <div>
            <div>
                <input type = "text" placeholder = "Enter Name..." id =""/>
            </div>
            <hr/>
            <div className="container">{
                names.map((name, index)=>(
                <p key = {index} className = {name.sex}>{(name.name)}</p>    
                ))
            }

            </div>
        </div>

    );
};
